import React from "react";
import "./App.css";
import Home from "./pages/Home";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <Router>

      <Switch>
        <Route path="/search">
          <h1>this is search page</h1>
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>

      <div className="App">

      {/** Home (Search Bar Page)*/}
      <Home/>


      {/** Search Result Page*/}
    </div>
    </Router>
  );
}

export default App;
